import React from 'react';

function CategoryList(props){

    return (

       <React.Fragment>
           {
               props.categories.map( categories=>{
                   return <h3 key = {categories.id}>{this.state.categories.title}</h3>
               })
           }
       </React.Fragment>

    );
}

export default CategoryList
